#include <vector>
using namespace std;

class Solution {
public:
    vector<int> getGoodIndices(vector<vector<int>>& variables, int target) {
        vector<int> goodIndices;
        for (int i = 0; i < variables.size(); ++i) {
            long long a = variables[i][0], b = variables[i][1], c = variables[i][2], m = variables[i][3];
            if (powerMod(a * b % 10, c, m) == target) {
                goodIndices.push_back(i);
            }
        }
        return goodIndices;
    }

private:
    long long powerMod(long long base, long long exponent, long long modulus) {
        long long result = 1;
        base = base % modulus;
        while (exponent > 0) {
            if (exponent % 2 == 1)
                result = (result * base) % modulus;
            exponent = exponent >> 1;
            base = (base * base) % modulus;
        }
        return result;
    }
};
